import React from 'react'
import "./Copyrightcomp.css"
const Copyrightcomp = () => {
  return (
    <div className='Copyright-comp'>
      <div className='copy-year'>2021</div>
      <div className='copy-C'>C</div>
      <div className='copy-laundry'>Laundry</div>
    </div>
  )
}

export default Copyrightcomp
